import {
    BrowserRouter as Router,
    Switch,   // Route를 찾는 것, route은 localhost:3000"/movies/123"에서 ""에 있는 URL을 의미한다. Route을 찾으면 컴포넌트를 render을 한다.
    Route,
} from "react-router-dom";
import Home from "./routes/Home";

function App() {
    return (
    <Router>
        <Switch> 
            <Route path="/">
                 <Home />
            </Route>
        </Switch>
    </Router>);
}

export default App;
